This landmark paper on estimation of age was E-published in the Journal of Anatomy, 2009. The abstract of paper can be accessed in pubmed at &lt;a href=&quot;
http://www.ncbi.nlm.nih.gov/pubmed/19470083&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
