However full text is not available to non subscribers. Here for the benefit of all, this paper in its entirety is provided. Shall be useful for doctors, medicolegal workers, Forensic Medicine specialists and everyone who is interested in age estimation. Anatomists, biochemists and physiologists would also find this paper useful.
